package org.beanfuse.rule.model;import org.beanfuse.model.pojo.LongIdObject;import org.beanfuse.rule.Parameter;public class RuleConfigParam extends LongIdObject {    /** 标准-规则 */    private RuleConfig ruleConfig;    /** 规则参数 */    private Parameter param;    /** 参数值 */    private String value;        public Parameter getParam() {        return param;    }        public void setParam(Parameter param) {        this.param = param;    }        public RuleConfig getRuleConfig() {        return ruleConfig;    }        public void setRuleConfig(RuleConfig ruleConfig) {        this.ruleConfig = ruleConfig;    }    public String getValue() {        return value;    }        public void setValue(String value) {        this.value = value;    }}